  authDomain: "pointacademy-pro.firebaseapp.com",
  projectId: "pointacademy-pro",
  storageBucket: "pointacademy-pro.appspot.com",
  messagingSenderId: "1088233927600",
  appId: "1:1088233927600:web:61ce5d7fe5ee926f0cb23b"
};

const app = initializeApp(firebaseConfig);
const storage = getStorage(app);

export { storage };
